import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import Home from './components/Home';
import Concerts from './components/Concerts';
import NightClub from './components/Nightclub';
import Artists from './components/Artists';
import Promotions from './components/Promotions';
import Products from './components/Products';
import News from './components/News';
import BusinessCustomers from './components/BusinessCustomers';
import TicketProtection from './components/TicketProtection';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="navbar">
        <ul className="navbar-links">
          <li><Link to="/">หน้าแรก</Link></li>
          <li><Link to="/concerts">คอนเสิร์ต</Link></li>
          <li><Link to="/night-club">โน๊ตคลับ</Link></li>
          <li><Link to="/artists">ศิลปิน</Link></li>
          <li><Link to="/promotions">โปรโมชั่น</Link></li>
          <li><Link to="/products">สินค้า</Link></li>
          <li><Link to="/news">ข่าวสาร</Link></li>
          <li><Link to="/business-customers">ลูกค้าธุรกิจ</Link></li>
          <li><Link to="/ticket-protection">บริการคุ้มครองบัตรการแสดง</Link></li>
        </ul>
      </div>
      <Switch>
        <Route path="/" exact component={Home} />
        <Route path="/concerts" component={Concerts} />
        <Route path="/night-club" component={NightClub} />
        <Route path="/artists" component={Artists} />
        <Route path="/promotions" component={Promotions} />
        <Route path="/products" component={Products} />
        <Route path="/news" component={News} />
        <Route path="/business-customers" component={BusinessCustomers} />
        <Route path="/ticket-protection" component={TicketProtection} />
      </Switch>
    </Router>
  );
};

export default App;
